export const AddTodoByUser = (todo) =>{
    fetch('https://dummyjson.com/todos/add', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
            todo: todo,
            completed: false,
            userId: 20,
        })
        })
        .then(res => res.json())
        return res;
}
